import axios from 'axios';

export const addBill = state => {
  let a = Object.keys.map(i => i);
  let data = state.map(i => i[a]);
  console.log(data);
  return axios
    .post('http://localhost:3001/bills', {
      [new Date().toDateString().slice(4)]: {
        name: Object.keys(state),
        sold: state.req
      }
    })
    .then(resp => {
      console.log(resp);
    });
};
